import React, { useState, useEffect } from 'react';
import api from '../utils/api';

function AdminPanelPage() {
  const [users, setUsers] = useState([]);
  const [files, setFiles] = useState([]);
  const [activeTab, setActiveTab] = useState('users');
  const [error, setError] = useState('');
  const [success, setSuccess] = useState('');

  useEffect(() => {
    const token = localStorage.getItem('token');
    if (!token) {
      window.location.href = '/login';
      return;
    }
    fetchData();
  }, [activeTab]);

  const fetchData = async () => {
    try {
      if (activeTab === 'users') {
        const response = await api.get('/api/admin/users');
        setUsers(response.data);
      } else {
        const response = await api.get('/api/admin/files');
        setFiles(response.data);
      }
    } catch (err) {
      if (err.response?.status === 403) {
        setError('Access denied. Admin privileges required.');
      } else {
        setError('Failed to fetch data');
      }
    }
  };

  const handleDeleteFile = async (fileId) => {
    if (!window.confirm('Are you sure you want to delete this file?')) return;
    
    try {
      await api.delete(`/api/admin/files/${fileId}`);
      setSuccess('File deleted successfully');
      fetchData();
    } catch (err) {
      setError('Failed to delete file');
    }
  };

  const handleLogout = () => {
    localStorage.removeItem('token');
    window.location.href = '/login';
  };

  return (
    <div style={{ padding: '20px' }}>
      <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', marginBottom: '20px' }}>
        <h1>Admin Panel</h1>
        <button onClick={handleLogout} style={{ padding: '10px 20px', backgroundColor: '#dc3545', color: 'white', border: 'none', borderRadius: '5px' }}>
          Logout
        </button>
      </div>

      {error && <p style={{color: 'red'}}>{error}</p>}
      {success && <p style={{color: 'green'}}>{success}</p>}

      <div style={{ marginBottom: '20px' }}>
        <button 
          onClick={() => setActiveTab('users')}
          style={{ 
            padding: '10px 20px', 
            marginRight: '10px',
            backgroundColor: activeTab === 'users' ? '#007bff' : '#f8f9fa',
            color: activeTab === 'users' ? 'white' : 'black',
            border: '1px solid #ddd',
            borderRadius: '5px'
          }}
        >
          Users
        </button>
        <button 
          onClick={() => setActiveTab('files')}
          style={{ 
            padding: '10px 20px',
            backgroundColor: activeTab === 'files' ? '#007bff' : '#f8f9fa',
            color: activeTab === 'files' ? 'white' : 'black',
            border: '1px solid #ddd',
            borderRadius: '5px'
          }}
        >
          Files
        </button>
      </div>

      {activeTab === 'users' && (
        <div>
          <h2>User Management</h2>
          <table style={{ width: '100%', borderCollapse: 'collapse' }}>
            <thead>
              <tr style={{ backgroundColor: '#f8f9fa' }}>
                <th style={{ padding: '10px', border: '1px solid #ddd' }}>Email</th>
                <th style={{ padding: '10px', border: '1px solid #ddd' }}>Role</th>
                <th style={{ padding: '10px', border: '1px solid #ddd' }}>Created</th>
              </tr>
            </thead>
            <tbody>
              {users.map(user => (
                <tr key={user._id}>
                  <td style={{ padding: '10px', border: '1px solid #ddd' }}>{user.email}</td>
                  <td style={{ padding: '10px', border: '1px solid #ddd' }}>{user.role}</td>
                  <td style={{ padding: '10px', border: '1px solid #ddd' }}>
                    {new Date(user.createdAt).toLocaleDateString()}
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      )}

      {activeTab === 'files' && (
        <div>
          <h2>File Management</h2>
          <table style={{ width: '100%', borderCollapse: 'collapse' }}>
            <thead>
              <tr style={{ backgroundColor: '#f8f9fa' }}>
                <th style={{ padding: '10px', border: '1px solid #ddd' }}>Title</th>
                <th style={{ padding: '10px', border: '1px solid #ddd' }}>Subject</th>
                <th style={{ padding: '10px', border: '1px solid #ddd' }}>Uploader</th>
                <th style={{ padding: '10px', border: '1px solid #ddd' }}>Downloads</th>
                <th style={{ padding: '10px', border: '1px solid #ddd' }}>Uploaded</th>
                <th style={{ padding: '10px', border: '1px solid #ddd' }}>Actions</th>
              </tr>
            </thead>
            <tbody>
              {files.map(file => (
                <tr key={file._id}>
                  <td style={{ padding: '10px', border: '1px solid #ddd' }}>{file.title}</td>
                  <td style={{ padding: '10px', border: '1px solid #ddd' }}>{file.subject}</td>
                  <td style={{ padding: '10px', border: '1px solid #ddd' }}>{file.uploader?.email}</td>
                  <td style={{ padding: '10px', border: '1px solid #ddd' }}>{file.downloadCount}</td>
                  <td style={{ padding: '10px', border: '1px solid #ddd' }}>
                    {new Date(file.uploadDate).toLocaleDateString()}
                  </td>
                  <td style={{ padding: '10px', border: '1px solid #ddd' }}>
                    <button 
                      onClick={() => handleDeleteFile(file._id)}
                      style={{ 
                        padding: '5px 10px', 
                        backgroundColor: '#dc3545', 
                        color: 'white', 
                        border: 'none', 
                        borderRadius: '3px',
                        cursor: 'pointer'
                      }}
                    >
                      Delete
                    </button>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      )}
    </div>
  );
}

export default AdminPanelPage;
